{% load widget_tweaks %}
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>W2Pdf</title>
  
    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css" integrity="sha384-T3c6CoIi6uLrA9TneNEoa7RxnatzjcDSCmG1MXxSR1GAsXEV/Dwwykc2MPK8M2HN" crossorigin="anonymous">
    <style>
        body{
            background-color:#E9E9E9;
        }
        .btn{
            background-color: #E9E9E9; 
            color: black;
            border-color: black;
            transition-duration: 0.4s;
            border-radius: 10px;
            
        }
        .startbtn:hover{
            background-color: black;
            color: white;
            
        }
        #file-label{
            cursor: pointer;
        }
        @font-face{
            font-family: Dalfitra;
            src : url('https://raw.githubusercontent.com/Rahmn-Dev/W2Pdf/main/app/templates/font/a/0x1101/D1.otf')
        }
        .app-cursor-dot{
            width: 5px;
            height: 5px;
            background-color: rgb(0, 0, 0);
            }
            .app-cursor-outline{
                width: 20px;
                height: 20px;
                background-color:  hsl(0, 0%, 100%);
                mix-blend-mode: difference;
            }
            .app-cursor-dot,.app-cursor-outline {
                position: fixed;
                top:0px;
                left: 0px;
                transform: translate(-50%,-50%);
                border-radius: 50%;
                z-index: 1;
                pointer-events: none;
            }
    </style>
</head>

            flex-wrap: nowrap;

                <a href="{{document.pdf_file.url}}" class="btn startbtn" style="margin-bottom:10px; margin-top:10px;">Download .pdf</a>
                <a href="{{document.pptx_file.url}}" class="btn startbtn" style="margin-bottom:10px; margin-top:10px;">Download .pptx</a>
